import React from 'react';

import { Container, HeaderSidebar } from './styles';

import { RiArrowDownSLine } from 'react-icons/ri'

const Sidebar: React.FC = () => {
  return (
    <Container>
      <HeaderSidebar>
        <h1>Guild</h1>
        <RiArrowDownSLine/>
      </HeaderSidebar>
    </Container>
  );
}

export default Sidebar;
